function MaxSubSequence(arr) {
    if (arr.length == 1) return arr[0]
    var dp = [arr[0]]
    for (var i = 1; i < arr.length; i++) {
        dp.push(Math.max(arr[i], dp[i - 1] + arr[i]))
    }
    return Math.max.apply(null, dp)
}

